import React, { Component } from "react";
import Layout from "../components/Layout";
import {
  Segment,
  Header,
  Image,
  List,
  Grid,
  Container,
  Button,
  Icon,
} from "semantic-ui-react";

class index extends Component {
  render() {
    return <Layout></Layout>;
  }
}

export default index;
